import React, { useEffect, useState } from 'react';
import api from '../services/api';
import './Reportes.css';
import MesesReportes from '../components/reportes/MesesReportes';

const Reportes = () => {
  const [resumenDias, setResumenDias] = useState([]);
  const [ventasPorDia, setVentasPorDia] = useState({});
  const [fechaBusqueda, setFechaBusqueda] = useState('');

  useEffect(() => {
    obtenerResumenDias();
  }, []);

  const obtenerResumenDias = async () => {
    const res = await api.get('http://localhost:5000/api/reportes/dias');
    setResumenDias(res.data);
  };

  const toggleDetalleDia = async (fecha) => {
    if (ventasPorDia[fecha]) {
      // Si esta abierto se cierra
      setVentasPorDia(prev => {
        const copia = { ...prev };
        delete copia[fecha];
        return copia;
      });
    } else {
      // Si estÃ¡ cerrado se abre
      const res = await api.get(`http://localhost:5000/api/reportes/detalle/${fecha}`);
      setVentasPorDia(prev => ({ ...prev, [fecha]: res.data }));
    }
  };
  
   const buscarPorFecha = async () => {
   if (!fechaBusqueda) return;
   const res = await api.get(`http://localhost:5000/api/reportes/buscar/${fechaBusqueda}`);
   setVentasPorDia({ [fechaBusqueda]: res.data });
   setResumenDias([{ dia: fechaBusqueda, total_dia: res.data.reduce((acc, v) => acc + parseFloat(v.total), 0) }]);
   };

   const restaurarResumen = () => {
      setFechaBusqueda('');
      obtenerResumenDias();      
      setVentasPorDia({});        
};

   const handleImprimir = (venta) => {
    const printWindow = window.open('', '_blank');

    const contenido = `
      <html>
        <head>
          <title>Ticket Venta #${venta.id}</title>
          <style>
            body {
              font-family: 'Courier New', monospace;
              width: 260px;
              margin: auto;
              text-align: center;
            }

            .logo {
              max-width: 150px;
              margin-bottom: 5px;
            }

            h2 {
              margin: 5px 0 3px 0;
              font-size: 16px;
            }

            .direccion {
              font-size: 12px;
              margin-bottom: 10px;
            }

            .ticket-info {
              font-size: 13px;
              margin-bottom: 10px;
            }

            .linea {
              border-top: 1px dashed #000;
              margin: 10px 0;
            }

            table {
              width: 100%;
              border-collapse: collapse;
              font-size: 12px;
              text-align: left;
              margin-top: 8px;
            }

            th, td {
              padding: 4px 2px;
            }

            th {
              border-bottom: 1px solid #000;
            }

            .total {
              font-weight: bold;
              font-size: 14px;
              text-align: right;
              margin-top: 12px;
            }

            .footer {
              margin-top: 12px;
              font-size: 13px;
            }
          </style>
        </head>
        <body>
          <img src="data:image/png;base64," class="logo" alt="Logo" />
          <h2>Papeleria Amistad</h2>
          <div class="direccion">
            Calle De la amistad #1414<br>
            Col. VillasPerisur, Zapopan, Jal.<br>
            WhatsApp. 33-4514-4736
          </div>

          <div class="ticket-info">
            Venta ID: ${venta.id}<br>
            Fecha: ${new Date(venta.fecha).toLocaleString()}
          </div>

          <div class="linea"></div>

          <table>
            <thead>
              <tr>
                <th>Cant</th>
                <th>Producto</th>
                <th>Desc</th>
                <th style="text-align: right;">Precio</th>
              </tr>
            </thead>
            <tbody>
              ${(venta.productos || [])
                .map(p => `
                  <tr>
                    <td>${p.cantidad}</td>
                    <td>${p.producto}</td>
                    <td>${p.descripcion || '-'}</td>
                    <td style="text-align: right;">$${(p.precio * p.cantidad).toFixed(2)}</td>
                  </tr>
                `)
                .join('')}
            </tbody>
          </table>

          <div class="linea"></div>

          <div class="total">
            TOTAL: $${Number(venta.total).toFixed(2)}
          </div>

          <div class="linea"></div>

          <div class="footer">Â¡Gracias por su compra!</div>
        </body>
      </html>
    `;

    printWindow.document.write(contenido);
    printWindow.document.close();
    printWindow.focus();
    printWindow.print();
    printWindow.close();
   };

   return (
    <div className="reportes-calendario">
      <h2>ð Reportes (Ãºltimos 28 dÃ­as)</h2>
      <div className="buscador-fecha">
      <input
         type="date"
         value={fechaBusqueda}
         onChange={(e) => setFechaBusqueda(e.target.value)}
      />
      <button onClick={buscarPorFecha}>ð Buscar</button>
      {fechaBusqueda && (
         <button onClick={restaurarResumen}>â©ï¸ Ver Ãºltimos 30 dÃ­as</button>
      )}
      </div>

      <div className="grid-calendario">
        {resumenDias.map((dia) => (
          <div key={dia.dia} className="calendario-dia">
            <div className="dia-header" onClick={() => toggleDetalleDia(dia.dia)}>
              <span>{new Date(dia.dia).toLocaleDateString()}</span>
              <strong>ð° ${dia.total_dia}</strong>
            </div>

            {ventasPorDia[dia.dia] && (
              <div className="ventas-detalle">
                {ventasPorDia[dia.dia].map((venta, i) => (
                  <div key={i} className="venta-item">
                    ð {new Date(venta.fecha).toLocaleTimeString()} â ${venta.total}
                    <button onClick={() => handleImprimir(venta)}>ð§¾</button>
                  </div>
                ))}
              </div>
            )}
          </div>
        ))}
      </div>
      <MesesReportes />
    </div>
  );
};

export default Reportes;